import React, { Component } from 'react';

import 'react-bulma-components/dist/react-bulma-components.min.css';

import AbakkusLogo from './imgs/AbakkusLogo.jpg'

import { Navbar, Image } from 'react-bulma-components';

class AbakkusNavbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Navbar>
                <Navbar.Brand>
                    <Navbar.Item renderAs="a" href="#">
                            <Image rounded={false} src="https://abakkusinvest.com/imgs/Abakkus%20Logo.jpg" style={{ height:60, width: 180 }}/>
                    </Navbar.Item>
                    <Navbar.Burger />
                </Navbar.Brand>
                <Navbar.Menu >
                    <Navbar.Container>
                        <Navbar.Item>Home</Navbar.Item>
                        <Navbar.Item>About</Navbar.Item>
                        <Navbar.Item>People</Navbar.Item>
                        <Navbar.Item>Blog</Navbar.Item>
                        <Navbar.Item dropdown hoverable href="#">
                            <Navbar.Link arrowless={false}>
                                Investor
                            </Navbar.Link>
                            <Navbar.Dropdown>
                                <Navbar.Item href="#">
                                    Investor Login
                                </Navbar.Item>
                                <Navbar.Item href="#">
                                    Dummy Item
                                </Navbar.Item>
                            </Navbar.Dropdown>
                        </Navbar.Item>
                    </Navbar.Container>
                </Navbar.Menu>
            </Navbar>
        )
    }
}

export default AbakkusNavbar;
